export const randomizeArray = (arr) => {
  let wordsArr = [...arr];
  for (let i = wordsArr.length - 1; i > 0; i--) {
    let j = Math.floor(Math.random() * i);
    let k = wordsArr[i];
    wordsArr[i] = wordsArr[j];
    wordsArr[j] = k;
  }
  return wordsArr;
};
